import React from 'react';


export default function About() {
    return (
        <section id = "about">
            <div className="container mx-auto flex px-10 py-20 md:flex-row flex-col items=-center">
                <div className="lg:flex-grow md:w-1/2 lg:pr-16 flex flex-col md:items-start md:text-left mb-16 md:mb-0 items-center text-center">
                    <h1 className="title-font sm:text-4xl text-3xl mb-4 font-medium text-white">
                        Nice to meet you, I'm Laura.
                    </h1>
                    <br className="hidden lg:inline-block" /> I love to learn as much as I can in whatever I can, coding included.

                </div>
            </div>

        </section>
    )

}
